الإنسان هو هو، لم يتغير منه شيء:
طمعه، حقده، هلعه، أنانيته، حبه، بغضه، حاجاته، جوعه، شبعه، فرحه، حزنه، زواجه، طلاقه، شهواته، تعلقه بأطفاله.
لذلك يصلحه اليوم ما أصلحه قبل 1400 عام، فلم يتغير سوى وسائل عيشه أما الإنسان فهو هو {خلق هلوعا إذا مسه الشر جزوعا وإذا مسه الخير منوعا}
